import coursesPersonal from "./CoursesPersonal.jsx";
import React from "react";
import { connect } from "react-redux";
import $api from "../../../../Http/index.js";

class coursesPersonalContainer extends React.Component {
  componentDidMount() {
    // this.props.loading(true);

    $api
      .get("course/personal/:id")
      .then((response) => {
        console.log(response);
        this.props.loading(false);
        this.props.setCourses(response.data);
        console.log("Vse zaebcom");
      })
      .catch((error) => {
        this.props.loading(false);
        console.log("user unauthorized");
        console.log(error);
      });
  }
}
export default coursesPersonalContainer;
